    return (
        <Container>
            <p style={{ fontSize: "10px", fontWeight: "bold", color: "#555" }}>test</p>
            <h1>test</h1>
            <p style={{ fontSize: "15px", fontWeight: "bold", color: "#555" }}>test</p>
        </Container>
    )
}


export default Component
